import React, { Component } from 'react';
import Spencer from '../img/spencer.jpg'

export default class About extends Component {
    render() {
        return (
            <div>
                <Card name="Spencer Nielsen" description="Spencer Nielsen is currently attending college at Walla Walla University, where he is studying Information Systems. This website has been created as part of a project for CPTR220 Web Application Development." email="mailto:amazingspencer13@gmail.com" />
                <Card name="Samuel Hernadez" description="Samuel Hernadez is currently studying Computer Science and is learning how to make websites!" email="mailto:Samuel.Hernadez@wallawalla.edu" />
                <Card name="Hayden Tinker" description="Hayden Tinker is currently studying Computer Science and is learning how to make fantastic websites!" email="mailto:Hayden.Tinker@wallawalla.edu" />
            </div>
        );
    }
}

// Renders a card based on props passed to it.
// Required props are: name, description, image source, and email with "mailto:"
class Card extends Component {
    render() {
        return (
            <div className="card" style={{ width: '30rem' }}>
                <img src={Spencer} className="card-img-top" alt={this.props.name}></img>
                <div className="card-body text-center">
                    <h5 className="card-title">{this.props.name}</h5>
                    <p className="card-text">{this.props.description}</p>
                    <a href={this.props.email} className="btn btn-primary" aria-label="button">Contact</a>
                </div>
            </div>
        );
    }
}
